import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      const name = "world";
      <header className="App-header">
        <a href="https://www.naver.com">go to naver</a>
        hello! {name}!
      </header>
    </div>
  );
}

export default App;
